  alt="Arrow Icon" aria-hidden="true") ul.select-box__list each option, index in
  options li label.select-box__option(for=index aria-hidden) #{"{"}option.name
  {"}"}
  +SelectBox('Ben', [{"{"}name: 'Cream', value: '1', checked: true{"}"},{"{"}
  name: 'Cheese', value: '2'{"}"},{"{"}name: 'Milk', value: '3'{"}"},{"{"}name:
  'Honey', value: '4'{"}"},{"{"}name: 'Toast', value: '5'{"}"}
  ])
    </div>
  )
}

